import React from 'react';
import WeatherExtraInfo from './WeatherExtraInfo'
import WeatherTemperature from './WeatherTemperature'
const WeatherData = () => (
    <div>
        <WeatherExtraInfo/>
        <WeatherTemperature/>
    </div>
);

export default WeatherData;
